CREATE TABLE `tasly_warehouse`.`tasly_warehouse_storage_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `material` varchar(255) NOT NULL DEFAULT '' COMMENT '物料号',
  `storage_bin` varchar(255) NOT NULL DEFAULT '' COMMENT '点位',
  `batch` varchar(255) NOT NULL DEFAULT '' COMMENT '批号',
  `material_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '物料名称',
  `avail_stock` float(19,3) DEFAULT NULL DEFAULT '0' COMMENT '库存量(小数点后三位)',
  `unit` varchar(255) NOT NULL DEFAULT '' COMMENT '单位',
  `last_goods_rec` varchar(20) NOT NULL DEFAULT '0.0' COMMENT '收货时间',
  `date_of_manuf` varchar(20) NOT NULL DEFAULT '0.0' COMMENT '生产日期',
  `sled_bbd` varchar(20) NOT NULL DEFAULT '0.0' COMMENT '有效期',
  `next_inspection` varchar(20) NOT NULL DEFAULT '0.0' COMMENT '复验期',
  `status` varchar(5) NOT NULL DEFAULT 'kk' COMMENT 'status 黄:S, 红:Q, 绿:空, 初始化值:kk',
  `create_time` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='天士力胜特仓库存储信息';

--

CREATE TABLE `tasly_warehouse_storage_bin` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `storage_bin` varchar(255) NOT NULL DEFAULT '' COMMENT '点位',
  `rack_type` varchar(255) NOT NULL DEFAULT '' COMMENT '高架库区1 货架号',
  `warehouse_type` int(11) NOT NULL DEFAULT '0' COMMENT '仓库类型',
  `create_time` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='天士力胜特仓库类型及点位号';


